css:
.title-bar {
  display: flex;
  flex-shrink: 0;
  align-items: center;
  justify-content: center;
  overflow: hidden;
  box-sizing: content-box;
  font-size: 13px;
  background-color: #f4f4f4;
  border-bottom: 1px solid #9f9f9f;
  transition: margin-top 160ms;
  -webkit-user-select: none;
  -webkit-app-region: drag;
}
.title-bar .title {
  flex: 0 1 auto;
  overflow: hidden;
  white-space: nowrap;
  text-overflow: ellipsis;
}
.is-blurred .title-bar {
  color: #999;
}
.custom-title-bar .title-bar {
  height: 22px;
  padding-left: 68px;
  padding-right: 68px;
}
.custom-title-bar.fullscreen .title-bar {
  margin-top: -22px;
}
.custom-title-bar atom-panel.modal {
  top: 22px;
}
.custom-inset-title-bar .title-bar {
  height: 38px;
  padding-left: 78px;
  padding-right: 78px;
}
.custom-inset-title-bar.fullscreen .title-bar {
  margin-top: -38px;
}
.custom-inset-title-bar atom-panel.modal {
  top: 38px;
}
.hidden-title-bar .status-bar {
  -webkit-app-region: drag;
}
